import React, { useState, useEffect } from 'react';
import {Redirect, Route,Link} from 'react-router-dom';
import {Switch} from 'react-router-dom';        //modified before it was react-router
import { withRouter } from 'react-router-dom';
import { Button,Navbar,Nav,Form,FormControl, Container,Row,Col,NavItem,Modal } from 'react-bootstrap';
//import Sidebar from 'react-bootstrap-sidebar';



class SideBar extends React.Component{
    render(){
        return <>
        <Modal className='menu-sidebar left' show={this.props.isVisible} onHide={this.props.onHide} autoFocus keyboard>
                <Modal.Header closeButton>
                    <Modal.Title>Menu</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    {this.props.children}
                </Modal.Body>
            </Modal>
        </>
    };
}

export default SideBar;
